def partition(items, pivot): 
    left = []
    right = []
    i = 0
    start = 0
    while i < len(items): 
        if items[i] < pivot: 
            left.append(items[i])
            i += 1
        else: 
            right.append(items[i])
            start = i + 1
            i += 1
    return(left[:start])
